    ibmat = static_cast<int32_T>(b_this->bufferCount + 1.0);
    for (b_jcol = 0; b_jcol < 13; b_jcol++) {
      b_this->poseBuffer[(ibmat + 6001 * b_jcol) - 1] = poses[b_jcol];
    }

    // this.poseBuffer(this.bufferCount:count + this.bufferCount,:) = pose(1:count+1,:) 
